void dispIntersection(double interArr[10]) {
    volatile int *HEX1 = (int *) 0xff200020;
    volatile int *HEX2 = (int *) 0xFF200030;

    int numIntersections = 0;
    for (int i = 0; i < 10; i += 2) {
        if (interArr[i] != 0.01 && interArr[i + 1] != 0.01) {
            numIntersections++;
        }
    }

    int indexInter = 0;
    while (1) {
        for (int i = 0; i < numIntersections; i++) {
            if (interArr[indexInter] != 0.01 && interArr[indexInter + 1] != 0.01) {
                
                if (interArr[indexInter] < 0 || interArr[indexInter] > 9 ||
                    interArr[indexInter + 1] < 0 || interArr[indexInter + 1] > 9) {
                    indexInter += 2;
                    if (indexInter >= 10) {
                        return; // Return instead of looping back
                    }
                    continue;
                }
                //printf("At index %d, the value store in the array is %f\n",indexInter, interArr[indexInter]);

                *HEX1 = (get_hex((int) interArr[indexInter]) << 8) |
                        get_hex((int) interArr[indexInter + 1]);
                *HEX2 = 0x0;
                delay(1500000);

                indexInter += 2;
                if (indexInter >= 10) {
                    return; // Return instead of looping back
                }
            } else {
                indexInter += 2;
                if (indexInter >= 10) {
                    return; // Return instead of looping back
                }
            }
        }
    }
}

int get_hex(int num) {
    switch(num) {
        case 0: return 0x3F; // Display 0
        case 1: return 0x06; // Display 1
        case 2: return 0x5B; // Display 2
        case 3: return 0x4F; // Display 3
        case 4: return 0x66; // Display 4
        case 5: return 0x6D; // Display 5
        case 6: return 0x7D; // Display 6
        case 7: return 0x07; // Display 7
        case 8: return 0x7F; // Display 8
        case 9: return 0x6F; // Display 9
        case -1: return 0x8; // Display -
        default: return 0x00; // Turn off display for non-digit numbers
    }
}

