void video_text(int x, int y, char * text_ptr);

void video_text(int x, int y, char * text_ptr) {
    int offset;
    volatile char * character_buffer = (char *)FPGA_CHAR_BASE; // video character buffer
    /* assume that the text string fits on one line */
    offset = (y << 7) + x;
    while (*text_ptr) {
        *(character_buffer + offset) = *(text_ptr); // write to the character buffer
        ++text_ptr;
        ++offset;
    }
}

int char_count = 0;

void createIntersectionString(double *interArr, char *text_ptr, int maxIntersections) {
    char_count = 0; // Counter to keep track of characters added to text_ptr
    int printedIntersections = 0; // Counter to keep track of printed intersections

    for (int i = 0; i < maxIntersections * 2; i += 2) {
        // Check if the intersection value is not equal to 0.01
        if (interArr[i] != 0.01) {
            // If this is not the first intersection, add a comma and space
            if (printedIntersections > 0) {
                char_count += sprintf(text_ptr + char_count, ", ");
            }
            // Add the intersection coordinates to text_ptr
            char_count += sprintf(text_ptr + char_count, "[%g, %g]", interArr[i], interArr[i+1]);
            printedIntersections++;
        }
    }
}

char* createEmptyString(int length) {
    if (length <= 0) {
        return NULL; // Return NULL if length is not positive
    }

    char* empty_string = (char*)malloc((length + 1) * sizeof(char)); // Allocate memory for the string
    if (empty_string == NULL) {
        return NULL; // Return NULL if memory allocation fails
    }

    // Fill the string with empty spaces
    for (int i = 0; i < length; i++) {
        empty_string[i] = ' ';
    }
    empty_string[length] = '\0'; // Add null terminator at the end

    return empty_string;
}

