void draw_line(int start_x, int start_y, int end_x, int end_y, short int line_color){
    bool steep = abs(end_y - start_y) > abs(end_x - start_x);
    int y_step;
    if( steep ){
        swap(&start_x, &start_y);
        swap(&end_x, &end_y);
    }
    if(start_x>end_x){
        swap(&start_x, &end_x);
        swap(&start_y, &end_y);
    }

    int dx = end_x - start_x;
    int dy = abs(end_y - start_y);
    int error = -(dx/2);
    int y = start_y;

    if(start_y < end_y){
        y_step = 1;
    }else{
        y_step = -1;
    }

    while(start_x != end_x){
        if(steep){
            plot_pixel_graph(y, start_x, line_color);
			plot_pixel_graph(y, start_x+1, line_color);
			plot_pixel_graph(y, start_x-1, line_color);
			plot_pixel_graph(y+1, start_x, line_color);
			plot_pixel_graph(y-1, start_x, line_color);
		
			plot_pixel_graph(y+1, start_x+1, line_color);
			plot_pixel_graph(y-1, start_x-1, line_color);
			plot_pixel_graph(y-1, start_x-1, line_color);
			plot_pixel_graph(y+1, start_x+1, line_color);
			
			plot_pixel_graph(y+1, start_x-1, line_color);
			plot_pixel_graph(y-1, start_x+1, line_color);
			plot_pixel_graph(y-1, start_x+1, line_color);
			plot_pixel_graph(y+1, start_x-1, line_color);
        }
        else{
			plot_pixel_graph(start_x, y, line_color);
			plot_pixel_graph(start_x, y+1, line_color);
			plot_pixel_graph(start_x, y-1, line_color);
			plot_pixel_graph(start_x+1, y, line_color);
			plot_pixel_graph(start_x-1, y, line_color);
			
			
			plot_pixel_graph(start_x+1, y+1, line_color);
			plot_pixel_graph(start_x-1, y-1, line_color);
			plot_pixel_graph(start_x-1, y-1, line_color);
			plot_pixel_graph(start_x+1, y+1, line_color);
			
			plot_pixel_graph(start_x+1, y-1, line_color);
			plot_pixel_graph(start_x-1, y+1, line_color);
			plot_pixel_graph(start_x-1, y+1, line_color);
			plot_pixel_graph(start_x+1, y-1, line_color);
        }
        error +=dy;
        start_x++;
        if(error > 0){
            y += y_step;
            error -= dx;
        }
    }
    
}

void swap(int* first, int*second){
    int temp = *first;
    *first = *second;
    *second = temp;
}



